export default {
  data: function data() {
    return {
      userName: "",
      Msg: {
        isShow: false,
        content: "",
        link: ""
      },
      isOpen: localStorage.getItem("name") ? false : true // isLoading: false

    };
  },
  watch: {
    isOpen: function isOpen(val) {
      return val;
    }
  },
  created: function created() {
    var _this = this;

    this.$bus.on("Msg", function (val) {
      _this.Msg = val;
    });
  },
  methods: {
    handleRouter: function handleRouter() {
      this.Msg.isShow = false;
      this.isOpen = false;

      if (!localStorage.getItem("name")) {
        localStorage.setItem("name", "".concat(this.userName));
        this.$bus.emit("name", this.userName);
      }

      if (this.Msg.link === "VueWorks") {
        this.$router.push("VueWorks");
      } else if (this.Msg.link === "index") {
        window.location.href = "https://shiang-c.github.io/web/"; // this.$router.push("/");
        // this.$router.go(0);
        // this.$router.replace("index");
      } else {
        return "";
      }
    },
    handleCancel: function handleCancel() {
      this.Msg.isShow = false;
    }
  }
};
